import React from 'react';
import '../styles/AuthPages.css';

const Home = () => {
  return (
    <div className="auth-page">
      <div className="auth-form">
        <h1>Welcome to AutoTrust</h1>
        <p>Buy and Sell Verified Used Cars with Confidence</p>
      </div>
    </div>
  );
};

export default Home;
